import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Box, Grid, Paper, Typography, Button } from '@mui/material';
import { Bar } from 'react-chartjs-2';

// ‚úÖ Chart.js registration to fix scale errors
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend
);

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);
  const [showDetails, setShowDetails] = useState(false);
  const [showQualifications, setShowQualifications] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData || !violationsData) return <div>Loading...</div>;

  const agentFirstName = commissionData.agentname ? commissionData.agentname.split(" ")[0] : "Agent";
  const weekStart = commissionData.week_start_date || "N/A";
  const weekEnd = commissionData.week_end_date || "N/A";

  // ‚úÖ Example Chart Data (Replace with your Commission History later)
  const barChartData = {
    labels: ['Week 1', 'Week 2', 'Week 3', 'Week 4'],
    datasets: [
      {
        label: 'Commission ($)',
        data: [500, 750, 620, 810],
        backgroundColor: 'rgba(211, 47, 47, 0.7)',
      },
    ],
  };

  const barChartOptions = {
    responsive: true,
    plugins: {
      legend: { position: 'top' },
      title: { display: true, text: 'Weekly Commission Trend' },
    },
  };

  return (
    <Box sx={{ fontFamily: "Arial, sans-serif", backgroundColor: "#f9f9f9", minHeight: "100vh" }}>
      {/* üî¥ Header */}
      <Box sx={{ backgroundColor: "#d32f2f", color: "#fff", display: "flex", alignItems: "center", justifyContent: "space-between", px: 2, py: 1 }}>
        <Box sx={{ display: "flex", alignItems: "center" }}>
          <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ height: "40px", marginRight: "10px" }} />
          <Typography variant="h6">Welcome, {agentFirstName} to Agent Dashboard</Typography>
        </Box>
        <Button onClick={handleLogout} sx={{ backgroundColor: "#fff", color: "#d32f2f", "&:hover": { backgroundColor: "#f1f1f1" } }}>Logout</Button>
      </Box>

      {/* ‚úÖ Layout Grid */}
      <Grid container spacing={2} sx={{ p: 2 }}>
        {/* üìù Weekly Commission */}
        <Grid item xs={12} md={6}>
          <Paper elevation={3} sx={{ p: 2 }}>
            <Typography variant="h6" color="error">Weekly Commission | {weekStart} - {weekEnd}</Typography>
            <Typography><strong>NB BF:</strong> {commissionData.nbrwbf}</Typography>
            <Typography><strong>Endo Fees:</strong> {commissionData.enfees}</Typography>
            <Typography><strong>NB+EN Total:</strong> {commissionData.totalnben}</Typography>
            <Typography><strong>Total Rev After Fees *:</strong> {commissionData["nben(afterfees)"]}</Typography>
            <Typography variant="caption" color="text.secondary">* must be $500 or more to qualify for commission.</Typography>

            <Box sx={{ mt: 1 }}>
              <Button variant="outlined" onClick={() => setShowDetails(!showDetails)} sx={{ mr: 1 }}>
                {showDetails ? "Hide Other Details" : "Show Other Details"}
              </Button>
              <Button variant="outlined" onClick={() => setShowQualifications(!showQualifications)}>
                {showQualifications ? "Hide Qualifications" : "Commission Qualifications"}
              </Button>
            </Box>

            {showDetails && (
              <Box sx={{ mt: 1 }}>
                {Object.entries(commissionData).map(([key, value]) => (
                  <Typography key={key}><strong>{key}:</strong> {value || "N/A"}</Typography>
                ))}
              </Box>
            )}

            {showQualifications && (
              <Box sx={{ mt: 2, backgroundColor: "#f1f1f1", p: 2, borderRadius: "5px" }}>
                <Typography variant="subtitle1">Commission Qualifications</Typography>
                <ul>
                  <li>10% Commission: Min 10 NBS</li>
                  <li>12.5% Commission: Min 17 NBS + $3,500 revenue</li>
                  <li>Revenue after deductions must be $500+</li>
                </ul>
              </Box>
            )}
          </Paper>
        </Grid>

        {/* üìä Commission Trend Chart */}
        <Grid item xs={12} md={6}>
          <Paper elevation={3} sx={{ p: 2 }}>
            <Bar options={barChartOptions} data={barChartData} />
          </Paper>
        </Grid>

        {/* ‚ö†Ô∏è Scanning Violations */}
        <Grid item xs={12}>
          <Paper elevation={3} sx={{ p: 2 }}>
            <Typography variant="h6" color="error">Scanning Violations & ARs</Typography>
            {Array.isArray(violationsData) && violationsData.length > 0 ? (
              violationsData.map((item, index) => (
                <Box key={index} sx={{ mb: 1 }}>
                  {Object.entries(item).map(([key, value]) => (
                    <Typography key={key}><strong>{key}:</strong> {value || "N/A"}</Typography>
                  ))}
                </Box>
              ))
            ) : (
              <Typography>No violations found.</Typography>
            )}
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
}

export default Dashboard;
